import styled from "@emotion/styled";
import { Box } from "@mui/material";

export default function Dashboard() {
  return (
    <Container>
      <h1>My Tasks</h1>
    </Container>
  );
}

const Container = styled(Box)(() => {
  return {
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",

    height: "100vh",
    width: "100vw",
    backgroundColor: "lightblue",
  };
});
